package org.springframework.samples.petclinic.model;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;

class NamedEntityTest {

	private NamedEntity instance;

	@BeforeEach
	void setUp() {
		instance = new NamedEntity();
	}

	@Test
	@DisplayName("Verifies that getName returns the value set by setName")
	void testGetNameReturnsSetValue() {
		NamedEntity entity = new NamedEntity();
		entity.setName("Fluffy");
		var result = entity.getName();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getName returns null when setName has been called with null")
	void testGetNameReturnsNullWhenNotSet() {
		NamedEntity entity = new NamedEntity();
		entity.setName(null);
		var result = entity.getName();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getName returns an empty string when setName is called with an empty string")
	void testGetNameReturnsEmptyString() {
		NamedEntity entity = new NamedEntity();
		entity.setName("");
		var result = entity.getName();
		assertEquals("", result);
	}

	@Test
	@DisplayName("Verifies that setName correctly sets the name field to a valid string")
	void testSetNameWithValidString() {
		instance.setName("Fluffy");
	}

	@Test
	@DisplayName("Verifies that setName handles an empty string input without throwing exceptions")
	void testSetNameWithEmptyString() {
		instance.setName("");
	}

	@Test
	@DisplayName("Verifies that setName handles null input, setting the name field to null")
	void testSetNameWithNull() {
		instance.setName(null);
	}

}
